INSERT INTO `catalogo` VALUES (1,'51101','Sueldos','Comprende las remuneraciones al personal que presta serviciospermanentes en las instituciones del sector público.'),(2,'51102','Salarios por Jornal','\"Comprende las remuneraciones al personal que presta serviciospermanentes en las instituciones del sector público, cuyo pagoes por hora.\"'),(3,'51103','Aguinaldos','\"Comprende la compensación adicional a favor del personal delos entes públicos, de conformidad a lo establecido en las leyesvigentes.\"'),(4,'51104','Sobresueldos','\"Comprende  las  remuneraciones  al  personal  de  los  entespúblicos, adicionales al sueldo que tiene asignado en la plazaque ha sido nombrado.\"'),(5,'51105','Dietas','\"Comprende  los  honorarios  que  devengan  los  miembros  deorganismos colegiados, de acuerdo a las normas legales que lasregulan.\"'),(6,'51106','Complementos','\"Comprende las retribuciones al personal de los entes públicos,en concepto de servicios personales prestados en tareas afinesa su ocupación,  que no constituyen una remuneración continua,\nni una bonificación.\"'),(7,'51107','Beneficios Adicionales','\"Comprende  las  remuneraciones  al  personal  de  los  entespúblicos no considerados en los específicos anteriores talescomo: bonificaciones, vacaciones etc.Remuneraciones EventualesComprende los gastos por las retribuciones al personal quepresta servicios de carácter eventual en los entes públicos.\"'),(8,'51201','Sueldos','\"Comprende las remuneraciones al personal que presta servicioseventuales en las instituciones del sector público, cuyo sistemade pago es a través de contratos.\"'),(9,'51202','Salarios por Jornal','\"Comprende las remuneraciones al personal que presta servicioseventuales en las instituciones del sector público, cuyo pago espor hora.\"'),(10,'51203','Aguinaldos','\"Comprende la compensación adicional a favor del personal delos entes públicos, de conformidad a lo establecido en las leyesvigentes.\"'),(11,'51204','Sobresueldos','\"Comprende  las  remuneraciones  al  personal  de  los  entespúblicos, adicionales al sueldo que tiene asignado en la plazaque ha sido nombrado.\"'),(12,'51206','Complementos','\"Comprende las retribuciones al personal de los entes públicos,en concepto de servicios personales prestados en tareas afinesa su ocupación,  que no constituyen una remuneración continua,ni una bonificación.\"'),(13,'51207','Beneficios Adicionales','\"Comprende  las  remuneraciones  al  personal  de  los  entespúblicos no considerados en los específicos anteriores talescomo: bonificaciones, vacaciones etc.\"'),(14,'51301','Horas Extraordinarias','\"Comprende las retribuciones al personal de los entes públicos,que   prestan   servicios   en   horas   fuera   de   audiencia,   deconformidad a la normativa vigente.\"'),(15,'51302','Beneficios Extraordinarios','\"Comprende las retribuciones al personal de los entes públicos,en concepto de incapacidades por enfermedad, accidentes detrabajo, etc., incluyendo ayudas económicas para compensargastos  ocasionados  por  tratamientos  médicos  y  otros  quepuedan derivarse de acuerdos o contratos colectivos de trabajo.Contribuciones  Patronales  a  Instituciones  de  SeguridadSocial PúblicasComprende los gastos de los entes públicos por aporte a lasinstituciones de seguridad social públicas, en su calidad deempleadores.\"'),(16,'51401','Por Remuneraciones Permanentes','Incluye   las   contribuciones   de   los   entes   públicos   a   lasinstituciones de seguridad social públicas en su carácter depatrono del personal en plazas permanentes.'),(17,'51402','Por Remuneraciones Eventuales','Incluye   las   contribuciones   de   los   entes   públicos   a   lasinstituciones de seguridad social públicas en su carácter depatrono del personal en plazas eventuales.'),(18,'51403','Por Remuneraciones Extraordinarias','\"Incluye   las   contribuciones   de   los   entes   públicos   a   lasinstituciones de seguridad social públicas en su carácter depatrono del personal que realiza trabajos en horas fuera deaudiencia.Contribuciones  Patronales  a  Instituciones  de  SeguridadSocial PrivadasComprende los gastos de los entes públicos por aporte a lasinstituciones de seguridad social privadas, en su calidad deempleadores.\"'),(19,'51501','Por Remuneraciones Permanentes','Incluye   las   contribuciones   de   los   entes   públicos   a   lasinstituciones de seguridad social privadas en su carácter depatrono del personal en plazas permanentes.'),(20,'51502','Por Remuneraciones Eventuales','Incluye   las   contribuciones   de   los   entes   públicos   a   lasinstituciones de seguridad social privadas en su carácter depatrono del personal en plazas eventuales.'),(21,'51503','Por Remuneraciones Extraordinarias','Incluye   las   contribuciones   de   los   entes   públicos   a   lasinstituciones de seguridad social privadas en su carácter depatrono del personal que realiza trabajos en horas fuera deaudiencia.'),(22,'51601','Por Prestación de Servicios en el País','\"Incluye los gastos de representación asignados a funcionariospúblicos,  de  conformidad  a  lo  establecido  en  la  normativavigente.\"'),(23,'51602','Por Prestación de Servicios en el Exterior','Incluye los gastos de representación asignados a funcionariospúblicos en delegaciones de comisión oficial fuera del territorionacional.'),(24,'51701','Al Personal de Servicios Permanentes','Incluye los gastos por indemnizaciones al personal que prestaservicios permanentes en las instituciones del sector público.'),(25,'51702','Al Personal de Servicios Eventuales','\"Incluye los gastos por  indemnizaciones al personal que prestaservicios eventuales en las instituciones del sector público.Comisiones por Servicios PersonalesComprende   los   gastos   de   emolumentos   basados   en   lasactividades   o   resultados   obtenidos,   tales   como:   ventas,recaudación de ingresos, recuperaciones de carteras u otros deigual naturaleza.\"'),(26,'51801','Comisiones por Ventas','\"Incluye las retribuciones al personal en concepto de comisionespor venta de bienes o servicios, de conformidad a la normativaestablecida.\"'),(27,'51802','Comisiones por Recaudaciones','\"Incluye las retribuciones al personal en concepto de comisionespor recaudaciones de ingresos, de conformidad a la normativaestablecida.\"'),(28,'51803','Comisiones por Recuperación de Carteras','\"Incluye las retribuciones al personal en concepto de comisionespor recuperación de la mora (deudores), de conformidad a lanormativa establecida.\"'),(29,'51899','Comisiones por Procedencia Diversas','Incluye las retribuciones al personal en concepto de comisionesdiversas no consideradas en los específicos anteriores.'),(30,'51901','Honorarios','\"Comprende  los  gastos  efectuados  por  servicios  eventualesproporcionados a favor del Estado, por ejemplo comparecenciaspara formar tribunales de conciencia.\"'),(31,'51902','Remuneraciones por Servicios Especiales','\"Comprende las retribuciones al personal que presta servicios enlas instituciones del sector público, que por su naturaleza seconsideran  servicios  especiales,  por  ejemplo  miembros  decomisiones especiales de gobierno, intergremiales, etc.\"'),(32,'51903','Prestaciones Sociales al Personal','\"Comprende los gastos por prestaciones sociales proporcionadasal   personal   de   los   entes   públicos,   tales   como:   cuotasalimenticias,   de   vestuario,   médicas,   escolares,   actividadessociales, etc.\"'),(33,'51999','Remuneraciones Diversas','\"Comprende    los    gastos    por    remuneraciones    diversasproporcionadas   al   personal   de   los   entes   públicos,   noconsideradas en los específicos anteriores.\"'),(34,'53101','Pensiones por Vejez','\"Comprende   los   gastos   realizados   por   los   organismos   deseguridad social, por las prestaciones que proporcionan a susafiliados,  para  asegurar  su  bienestar  al  haber  cumplido  losrequisitos de ley correspondiente.\"'),(35,'53102','Pensiones por Invalidez','\"Comprende   los   gastos   realizados   por   los   organismos   deseguridad social, por las prestaciones que proporcionan a susafiliados para asegurar su bienestar cuando hayan perdido sucapacidad   permanente   para   ejercer   cualquier   trabajo,   deconformidad a la ley correspondiente.\"'),(36,'53103','Pensiones por Viudez','\"Comprende   los   gastos   realizados   por   los   organismos   deseguridad social, por retribuciones en concepto de pensión a loscónyuges del   afiliado   cuando   éste   haya   fallecido,   deconformidad a la ley correspondiente.\"'),(37,'53104','Pensiones por Orfandad','\"Comprende   los   gastos   realizados   por   los   organismos   deseguridad social, por retribuciones en concepto de pensión a loshijos del afiliado cuando este haya fallecido, de conformidad a laley correspondiente.\"'),(38,'53105','Beneficios por Incapacidad Temporal','\"Comprende   los   gastos   realizados   por   los   organismos   deseguridad social a favor de sus afiliados, por ejemplo beneficiospor incapacidad temporal para ejercer su trabajo. Se incluyenademás los gastos en concepto de auxilio de sepelios.\"'),(39,'53106','Beneficios Adicionales','Comprende   los   gastos   realizados   por   los   organismos   deseguridad   social   en   concepto   de   aguinaldos   para   lospensionados del sistema de pensiones públicas.'),(40,'53199','Pensiones y Jubilaciones Diversas','\"Comprende otros gastos por pensiones y jubilaciones realizadospor los organismos de seguridad social a favor de sus afiliados ybeneficiarios, no considerados en los específicos anteriores.\"'),(41,'54101','Productos Alimenticios para Personas','\"Incluye los gastos por la adquisición de productos alimenticios,manufacturados o no, aceites y grasas animales, vegetales ybebidas  en  sus  diversas  formas.  Asimismo,  comprende  losgastos en concepto de alimentación.\"'),(42,'54102','Productos Alimenticios para Animales','Incluye los gastos por la adquisición de forrajes y toda clase dealimentos para animales.'),(43,'54103','Productos Agropecuarios y Forestales','\"Incluye los gastos por la adquisición de ganado y otros animalesdestinados  al  consumo,  así  mismo  productos  agroforestalestales como: maderas, fibras no elaboradas, cueros, huesos,resinas    y    bálsamos,    césped,    árboles    y    productosmanufacturados o no, de madera y corcho, excepto muebles\"'),(44,'54104','Productos Textiles y Vestuarios','\"Incluye los gastos por la adquisición de hilados y telas (fibras ytejidos animales, vegetales, sintéticos y artificiales); acabadostextiles (sabanas, fundas frazadas, mantas, alfombras, cortinas,toallas, sogas, cordeles, artículos conexos de cáñamo, yute,algodón y fibras sintéticas) y prendas de vestir (trajes, uniformes,calzados de todo tipo, carteras, camisas, pantalones, calcetines,corbatas, gabachas, etc.).\"'),(45,'54105','Productos de Papel y Cartón','\"Incluye los gastos por la adquisición de productos de papel ycartón para oficina (papel y cartón en sus diversas formas,formularios,  planillas,  folletos  de  cualquier  índole,  tarjetas,calendarios, libretas, libros de contabilidad, cartapacios, etc.),para  computación,  imprenta  y  reproducción (en  bobinas,  enplanchas  y  prensado),  papel  de  seguridad,  así  como  otrosproductos de papel y cartón para otros usos.\"'),(46,'54106','Productos de Cuero y Caucho','\"Incluye los gastos por la adquisición de productos de cuero ypieles   elaborados   o   semielaborados (maletas,   carterones,guantes, portafolios y otros artículos de talabartería excluido elcalzado) y artículos de caucho (esponjas, almohadas, asientos,colchones,  mangueras,  tubos,  guantes  para  cualquier  uso,excepto los de uso médico-quirúrgico, etc. ).\"'),(47,'54107','Productos Químicos','\"Incluye los gastos por la adquisición de compuestos químicos(gas industrial, oxígeno líquido y comprimido, acetileno, gasrefrigerante, ácidos, sales, alcohol, etc.); abonos y fertilizantes;insecticidas y fumigantes (fungicidas, plaguicidas, herbicidas,productos antigerminantes, desinfectantes, etc.); tintas, pinturasy  colorantes (tintas  para  imprenta,  dibujo  y  otros;  pinturas,barnices, esmaltes y lacas; pigmentos y colores preparados,disolventes, diluyentes y removedores; masillas y preparadossimilares)  y  productos  de  material  plástico (láminas,  bolsas,tubos y accesorios de PVC, etc.).\"'),(48,'54108','Productos Farmacéuticos y Medicinales','\"Incluye los gastos por la adquisición de sustancias y medicinaspara la prevención, tratamiento y curación de enfermedades depersonas.  Comprende  preparados   genéricos   y   de   marcasregistradas, ampollas, cápsulas, tabletas, ungüentos, vitaminas,sueros,  antibióticos;  productos  para  cirugía,  vendajes  parafractura y productos para sutura, preparados  para higiene bucaly dental;  asimismo se consideran los medicamentos y productosfarmacéuticos y demás artículos para uso veterinario.\"'),(49,'54109','Llantas y Neumáticos','Incluye los gastos por la adquisición de llantas y neumáticospara vehículos automotores de toda clase.en concepto de servicios personales prestados en tareas afines'),(50,'54110','Combustibles y Lubricantes','\"Incluye los gastos por la adquisición de petróleo crudo, gasolina,aceites  y  grasas  lubricantes,  aceite  diesel,  kerosene,  gasComprende  las  remuneraciones  al  personal  de  los  entespropano, etc.\"'),(51,'54111','Minerales no Metálicos y Productos Derivados','\"Incluye los gastos por la adquisición de minerales no elaboradostales como: arena, cascajo, piedra, arcilla, tierra, mármol, etc.; yComprende los gastos por las retribuciones al personal quesus derivados, por ejemplo: artículos de cerámica, vidrio, loza,porcelana,  cemento,  cal,  yeso,  asbesto  y  demás  productoselaborados con minerales no metálicos.\"'),(52,'54112','Minerales Metálicos y Productos Derivados','\"Incluye los gastos por la adquisición de minerales metálicos sinelaborar, tales como: aluminio, cobre, plomo, estaño, hierro,Salarios por Jorna